	private void scrollSeatView() {
		if (flightAirChinaSeatView.getVisibility()==View.VISIBLE) {
			float firstSelectSeatPosition = flightAirChinaSeatView.getFirstSelectSeatPosition();
			if (firstSelectSeatPosition==0) {//延迟几秒  获取第一个可选座位
				mHandler.postDelayed(new Runnable() {
					@Override
					public void run() {
						scrollViewAnimal();
					}
				},300);
			} else {
				scrollViewAnimal();
			}
		}
	}
	private void scrollDownSeatView() {
		if (flightBottomSeatView.getVisibility()==View.VISIBLE) {
			float firstSelectSeatPosition = flightBottomSeatView.getFirstSelectSeatPosition();
			if (firstSelectSeatPosition==0) {//延迟几秒  获取第一个可选座位
				mHandler.postDelayed(new Runnable() {
					@Override
					public void run() {
						scrollDownViewAnimal();
					}
				},300);
			} else {
				scrollDownViewAnimal();
			}
		}
	}

	private Handler mHandler = new Handler();

	private void scrollViewAnimal () {
		float firstSelectSeatPosition = flightAirChinaSeatView.getFirstSelectSeatPosition();
		if (0==firstSelectSeatPosition || !isDefaultScroll) {//0不滑动
			if (0==firstSelectSeatPosition) {//没有可选座位
				isDefaultScroll = false;
			}
			return;
		}
		final ScrollViewOritention scroll_view = findViewById(R.id.scroll_view);
		ValueAnimator valueAnimator = ValueAnimator.ofFloat(firstSelectSeatPosition);
		valueAnimator.setInterpolator(new DecelerateInterpolator());
		valueAnimator.setDuration(1000);
		valueAnimator.addUpdateListener(new ValueAnimator.AnimatorUpdateListener() {
			@Override
			public void onAnimationUpdate(ValueAnimator valueAnimator) {
				float value = Float.parseFloat(valueAnimator.getAnimatedValue().toString());
				scroll_view.scrollTo(0, (int) value);

			}
		});
		valueAnimator.addListener(new AnimatorListenerAdapter() {
			@Override
			public void onAnimationEnd(Animator animation) {
				super.onAnimationEnd(animation);
				mHandler.postDelayed(new Runnable() {
					@Override
					public void run() {
						isDefaultScroll = false;
					}
				},100);
			}
		});
		valueAnimator.start();
	}

	private void scrollDownViewAnimal() {
		float firstSelectSeatPosition = flightBottomSeatView.getFirstSelectSeatPosition();
		if (0==firstSelectSeatPosition || !isDownDefaultScroll) {//0不滑动
			return;
		}
		final ScrollViewOritention scroll_view = findViewById(R.id.scroll_view);
		ValueAnimator valueAnimator = ValueAnimator.ofFloat(firstSelectSeatPosition);
		valueAnimator.setInterpolator(new DecelerateInterpolator());
		valueAnimator.setDuration(1000);
		valueAnimator.addUpdateListener(new ValueAnimator.AnimatorUpdateListener() {
			@Override
			public void onAnimationUpdate(ValueAnimator valueAnimator) {
				float value = Float.parseFloat(valueAnimator.getAnimatedValue().toString());
				scroll_view.scrollTo(0, (int) value);

			}
		});
		valueAnimator.addListener(new AnimatorListenerAdapter() {
			@Override
			public void onAnimationEnd(Animator animation) {
				super.onAnimationEnd(animation);
				mHandler.postDelayed(new Runnable() {
					@Override
					public void run() {
						isDownDefaultScroll = false;
					}
				},100);
			}
		});
		valueAnimator.start();
	}
	

	/**设置选中的座位信息*/
	private void setSelectSeatInfo (List<String> seatNoList,FlightAirChinaSeatViewCanvas flightAirChinaSeatView) {
		int indexCurrentPerson = flightAirChinaSeatView.getIndexCurrentPerson();
		//因为这里的乘机人list大小一致  所以这里替换选中的座位信息
		if (seatNoList.size()==selectedSeatList.size()) {
			String seatNo = seatNoList.get(indexCurrentPerson);
			selectedSeatList.set(indexCurrentPerson,seatNo);
			radioButtonIds[indexCurrentPerson].setText(MapUtils.getObject(psrList.get(indexCurrentPerson)) + " " + seatNo);
		}
	}


