	/**是否默认滚动*/
	private boolean isDefaultScroll = true;
	/**下层是否默认滚动*/
	private boolean isDownDefaultScroll = true;
	@Override
	public void onCheckedChanged(RadioGroup group, int checkedId) {
		View viewById = group.findViewById(checkedId);
		if (!viewById.isPressed()){
			return;
		}

		switch (group.getId()) {
			case R.id.rg_person_row://值机人
				int psrIndex = 0;
				switch (checkedId){
					case R.id.rb_person0:
						psrIndex = 0;
						break;
					case R.id.rb_person1:
						psrIndex = 1;
						break;
					case R.id.rb_person2:
						psrIndex = 2;
						break;
					case R.id.rb_person3:
						psrIndex = 3;
						break;
				}
				if (null!=flightAirChinaSeatView) {//上层  单层
					flightAirChinaSeatView.setIndexCurrentPerson(psrIndex);
				}
				if (null!=flightBottomSeatView) {//下层
					flightBottomSeatView.setIndexCurrentPerson(psrIndex);
				}
				break;
			case R.id.rg_upper_lower://上下层
				if (R.id.rb_upper == checkedId) {//上层
					isDefaultScroll = true;
					flightAirChinaSeatView.setVisibility(View.VISIBLE);
					flightBottomSeatView.setVisibility(View.GONE);
				} else {
					isDownDefaultScroll = true;
					flightAirChinaSeatView.setVisibility(View.GONE);
					flightBottomSeatView.setVisibility(View.VISIBLE);
				}

				break;
		}
	}


